// DepartmentFactory.sol
pragma solidity ^0.8.20;
import "@openzeppelin/contracts/utils/math/Math.sol";
import "hardhat/console.sol";
contract DepartmentFactory {
    uint private departmentDigits = 16;
    uint private modulus = 10 ** departmentDigits;
    uint private randNonce = 0;
    bytes32 private merkleRoot;

    struct Department {
        uint id;
        string name;
    }


    mapping(uint => Department) public departments;
    uint[] private departmentKeys;

    constructor(){
       departmentKeys=[1,2,3,4,5];
    }
    function _generateRandomId(string memory _name) private returns (uint256) {
        uint id = uint(keccak256(abi.encode(_name, randNonce, block.timestamp))) % modulus;
        return id;
    }

    function createDepartment(string memory _name) public returns (Department memory) {
        require(!_departmentExists(_name), "Department has already existed");
        uint id = _generateRandomId(_name);
        departments[id] = Department(id, _name);
        departmentKeys.push(id);

        return departments[id];
    }
    function getDepartments() public view returns(Department[] memory) {
        Department[] memory result=new Department[](departmentKeys.length);
        for(uint i=0;i<departmentKeys.length;i++){
            result[i]=departments[departmentKeys[i]];
        }
        return result;

    }

    function _departmentExists(string memory _name) private  returns (bool) {
        for (uint i = 0; i < departmentKeys.length; i++) {
            if (keccak256(abi.encodePacked(departments[departmentKeys[i]].name)) == keccak256(abi.encodePacked(_name))) {
                return true;
            }
        }
        return false;
    }

    function departmentKeyExists(uint _id) public returns (bool){
        for (uint i = 0; i < departmentKeys.length; i++) {
            if (departmentKeys[i] == _id) {
                return true;
            }
        }
        return false;
    }

    function generateMerkleRoot() public returns (bytes32){
        uint DepartmentKeysLength=departmentKeys.length;
        if(DepartmentKeysLength==0) return 0x0;
        bytes32[] memory  departmentKeyHashes=new bytes32[](departmentKeys.length);
        for(uint i=0;i<departmentKeys.length;i++){
            departmentKeyHashes[i]=(keccak256(abi.encodePacked(departmentKeys[i])));

        }
//        console.log("",departmentKeyHashes);
        uint length=departmentKeyHashes.length;
        while(length>1){
            console.log("new turn",length);
            uint counter=0;
            for(uint i=0;i<length;i+=2){
                if(i==length-1){
                    console.log("input: ",i);
                    console.logBytes32(departmentKeyHashes[i]);
                    departmentKeyHashes[counter]=keccak256(abi.encodePacked(departmentKeyHashes[i],departmentKeyHashes[i]));
                    console.log("end");
                }else{
                    console.log("input: ",i);
                    console.logBytes32(departmentKeyHashes[i]);
                    console.logBytes32(departmentKeyHashes[i+1]);
                    departmentKeyHashes[counter] =keccak256(abi.encodePacked(departmentKeyHashes[i],departmentKeyHashes[i+1]));
                    console.log("end");
                }
                console.log("output: ");
                console.logBytes32(departmentKeyHashes[counter]);
                counter++;
            }
            length=counter;
        }
        return departmentKeyHashes[0];
    }
        function getMerklePath(uint departmentIds) public returns (bytes32[] memory){
          bytes32[] memory  result=new bytes32[](Math.log2(departmentKeys.length));
            console.log(Math.log2(departmentKeys.length));
            bytes32[] memory  departmentKeyHashes=new bytes32[](departmentKeys.length);
            for(uint i=0;i<departmentKeys.length;i++){
                departmentKeyHashes[i]=(keccak256(abi.encodePacked(departmentKeys[i])));
            }
            uint position=_getDepartmentPosition(departmentIds,departmentKeyHashes);
            console.log("position:", position);
            uint counterResult=0;
            if(position!= type(uint).max){
                uint length=departmentKeyHashes.length;
                while(length>1){
                    console.log("new turn",length);
                    uint counter=0;
                    for(uint i=0;i<length;i+=2){
                        if(i==length-1){
                            if(position==i){
                                result[counterResult]=departmentKeyHashes[i];
                                counterResult++;
                                console.logBytes32(result[counterResult]);
                            }
                            departmentKeyHashes[counter]=keccak256(abi.encodePacked(departmentKeyHashes[i],departmentKeyHashes[i]));
                        }else{
                            if(position==i){
                                result[counterResult]=departmentKeyHashes[i+1];
                                counterResult++;
                                console.logBytes32(result[counterResult]);
                            }else if(position==i+1){
                                result[counterResult]=departmentKeyHashes[i];
                                counterResult++;
                                console.logBytes32(result[counterResult]);
                            }
                            departmentKeyHashes[counter] =keccak256(abi.encodePacked(departmentKeyHashes[i],departmentKeyHashes[i+1]));
                        }
                        counter++;
                        position=position/2;
                    }
                    length=counter;
                }
            }
            for(uint i=0;i<result.length;i++){
                console.logBytes32(result[i]);
            }
        return result;
    }

