contracts/EmployeeFactory.sol.content:
pragma solidity ^0.8.20;

import "./DepartmentFactory.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
contract EmployeeFactory {
    uint private employeeDigits = 16;
    uint private modulus = 10 ** employeeDigits;
    uint private randNonce=0;
    uint public employeeMerkleRoot;
    DepartmentFactory public departmentInstance;

    constructor(address _departmentAddress){
        departmentInstance=DepartmentFactory(_departmentAddress);
    }
    struct Employee {
        uint id;
        string name;
        string phoneNumber;
        uint departmentId;
        uint managerId;
        string role;
    }

    mapping(uint  => Employee)  public employees;
    mapping(uint => Employee) public managers;

    uint[] private  employeeKeys;
    uint[] private managerKeys;


    function generateEmployee(string memory  _name, string memory  _phoneNumber, uint _departmentId, uint _managerId, string  memory _role) public returns (bool){
        require(!_phoneNumberExists(_phoneNumber), "Phone number is existed");
        if (keccak256(abi.encodePacked(_role)) == keccak256(abi.encodePacked("Manager"))) {
            //need to validate the _managerId and _departmentId
            uint id = _generateRandomId(_phoneNumber);
            employees[id] = Employee(id, _name, _phoneNumber, _departmentId, _managerId, _role);
            employeeKeys.push(id);
            managers[id] = employees[id];
            managerKeys.push(id);
            return true;
        } else if (keccak256(abi.encodePacked(_role)) == keccak256(abi.encodePacked("Employee"))) {
            if(_managerId>0)   require(_managerExists(_managerId), "Don't exists the manager ");
            uint id = _generateRandomId(_phoneNumber);
            employees[id] = Employee(id, _name, _phoneNumber, _departmentId, _managerId, _role);
            employeeKeys.push(id);
            return true;
        }
        return false;

    }
    function deleteEmployee(uint _employeeId) public returns (bool){
        uint indexToDelete=0;
        for(uint i=0;i<employeeKeys.length;i++){
            if(employeeKeys[i]==_employeeId){
                indexToDelete=i;
                break;
            }
        }
        if(indexToDelete==0) return false;
        else{
            if(keccak256(abi.encode(employees[indexToDelete].role))==keccak256(abi.encode("Manager"))){
                uint indexToDeleteManager=0;
                for(uint i=0;i<employeeKeys.length;i++){
                    if(employees[i].managerId == _employeeId){
                        employees[i].managerId=0;
                    }
                }
                for(uint i=0;i<managerKeys.length;i++){
                    if(managerKeys[i]== _employeeId){
                        indexToDeleteManager=0;
                    }
                }
                managerKeys[indexToDeleteManager]=managerKeys[managerKeys.length-1];
                managerKeys.pop();
            }
            delete employees[indexToDelete];
            employeeKeys[indexToDelete]=employeeKeys[employeeKeys.length -1];
            employeeKeys.pop();
        }
        return true;
    }

    function getEmployees() public view returns (Employee[] memory){
        Employee[] memory result=new Employee[](employeeKeys.length);
        for (uint i = 0; i < employeeKeys.length; i++) {
            result[i] = employees[employeeKeys[i]];
        }
        return result;
    }

    function updateEmployee(uint _employeeId,string memory _name,string memory _phoneNumber,uint _departmentId,uint _managerId,string  memory _role) public {
        require(_employeeExists(_employeeId),"Employee does not exists");
        if(bytes(_phoneNumber).length> 0){
            require(!_phoneNumberExists(_phoneNumber),"Phone number exists");
            employees[_employeeId].phoneNumber=_phoneNumber;
        }

        if(bytes(_name).length>0) employees[_employeeId].name=_name;
        if(_managerId>0){
            require(_managerExists(_managerId),"Manager does not exists");
            employees[_managerId].managerId=_managerId;
        }
        // need to update the department later

    }

    function _generateRandomId(string memory _phoneNumber) private returns (uint){
