        for (uint i = 0; i < employeeKeys.length; i++) {
            if (keccak256(abi.encodePacked(employeeKeys[i])) == keccak256(abi.encodePacked(_phoneNumber))) {
                return true;
            }
        }
        return false;
    }

    function _managerExists(uint _id) private returns (bool){
        for (uint i = 0; i < managerKeys.length; i++) {
            if (managerKeys[i] == _id) {
                return true;
            }
        }
        return false;
    }

    function _employeeExists(uint _id) private returns (bool){
        for (uint i = 0; i < employeeKeys.length; i++) {
            if (employeeKeys[i] == _id) {
                return true;
            }
        }
        return false;
    }


